import React from 'react';
import './styles.css'; // Asegúrate de que esta ruta sea correcta

const Home = () => {
    return (
        <div className="home-container">
            <div className="home-image-container">
                <img src="/home.gif" alt="Home" className="home-image" />
            </div>
            <div className="home-text">
                <h2>Welcome to Our Store!</h2>
                <p>This is a sample text that you can edit.</p>
            </div>
            <a href="https://wa.me/yourwhatsappnumber" className="whatsapp-button">
                <img src="/whalogo.png" alt="WhatsApp" />
            </a>
            <div className="products-button">
                <a href="/products" className="custom-button">Mira nuestros productos</a>
            </div>
        </div>
    );
};

export default Home;
